import React, {Component} from 'react';
import Button from '@material/react-button';
import TopAppBar, {TopAppBarFixedAdjust} from '@material/react-top-app-bar';
import MaterialIcon from '@material/react-material-icon';

import './App.scss';

import logo from './aprendiCODEWhite.png';
import learnImg from './learn.png';
import exploreImg from './explore.png';
import aboutImg from './about.png';
import signinImg from './signin.png';

class Header extends Component {
  render() {
    return (
      <div className="header">
        <img className="header-logo" src={logo} alt="logo"></img>
        <div className="header-space"></div>
        <div className="header-buttons">
          <Button className="header-button mdc-button--outlined">
            <img className="header-button-img" src={learnImg} alt="logo"></img>
            <span>Learn</span>
          </Button>
          <Button className="header-button mdc-button--outlined">
            <img className="header-button-img" src={exploreImg} alt="logo"></img>
            <span>Explore</span>
          </Button>
          <Button className="header-button mdc-button--outlined">
            <img className="header-button-img" src={aboutImg} alt="logo"></img>
            <span>About</span>
          </Button>
          <Button className="header-button mdc-button--outlined">
            <img className="header-button-img" src={signinImg} alt="logo"></img>
            <span>Sign In</span>
          </Button>
        </div>
      </div>
    );
  }
}

class App extends Component {
  render() {
    return (
      <div className="homepage">
        <Header />

      </div>
    );
  }
}

export default App;
